import React from 'react'
import Form from 'react-bootstrap/Form'

export const DisplayField = ({ name, value, type }) => {
    return (
        <div>
            <Form.Group >
                <Form.Label>{name}</Form.Label>
                <Form.Control type={type} readOnly value={value} />
            </Form.Group>
        </div>
    )
}

export default DisplayField
